import image from './mockup2.PNG';
import image2 from './mockup.PNG';
const tileData = [
  {
    img: image,
    title: 'Breakfast',
    author: 'jill111',
  },
  {
    img: image2,
    title: 'Tasty burger',
    author: 'director90',
  },
];

export default tileData;
